<node COLOR="#990000" CREATED="1157296551078" ID="Freemind_Link_337909936" MODIFIED="1159170571421" STYLE="bubble" TEXT="Geweihfarn:&#xa;Platycerium bifurcatum&#xa;Familie: Polypodiaceae&#xa;Heimat/Herkunft: Australien, Queensland, Neuguinea&#xa;Wuchsform: Eigenwillige Wuchsform mit zwei verschiedenen Blattarten und -formen. Als Epiphyt ausgebildet entwickeln sich an der Basis flach liegende Schuppenbl&#xe4;tter, die sp&#xe4;ter eintrocknen&#xa;und die Wurzeln sch&#xfc;tzen. Aufstrebend aus Basisknospen bilden sich geweihartig geteilte, graugr&#xfc;n&#xa;beflaumte Bl&#xe4;tter.&#xa;Planzenh&#xf6;he: 20 bis 50 cm&#xa;Temperatur- und Lichtanspr&#xfc;che: Heller Standort bei 20&#xb0;C, volle Sonne meiden.&#xa;Substrat/ph Wert: Grobhumoses Substrat mit etwas Nadelerdezusatz, ph wert: 4,5 bis 5,5&#xa;Besondere Pflegehinweise: W&#xf6;chentlich 1 bis 2 Wasserb&#xe4;der in verd&#xfc;nnter N&#xe4;hrsalzl&#xf6;sung von 0,5 pro Mille. Nicht austrocknen lassen. Bl&#xe4;tter nicht abwaschen!&#xa;Vermehrungsart: Aussaat der Sporen &#xa;Pflanzenschutz: Anf&#xe4;llig gegen Schildl&#xe4;use">
